e = function(i,type){
  let gems = 0;
  const level = Math.trunc(type / 100);  
  if (level === 1){
    gems = 20;    
  } else
  if (level === 2){
    gems = 80;    
  } else
  if (level === 3){
    gems = 180;    
  } else
  if (level === 4){
    gems = 320;    
  } else    
  if (level === 5){
    gems = 500;    
  } else
  if (level === 6){
    gems = 720;    
  } else  
  if (level === 7){
    gems = 980;    
  }
  game.ships[i].set({type:type,stats:88888888,crystals:gems});
};
